import { useEffect, useState } from 'react'

function Display() {
  const { data, setData } = useState(null);
  useEffect(() => {
    fetch("")
      .then((resp) => resp.json())
      .then((apiData) => {
        setData(apiData.message);
      })
  })

  return  (
    <div className="boxes">

            <p>p</p>
              <br />
          </div>
        )
    }

  export default Display
